        $cOmpuTeRNAmE = 'localhost',

        [MaNAGEmenT.AuTOMatioN.PScrEDENtIal]
        [Management.Automation.CredentialAttribute()]
        $CREdentiaL = [MaNAGEmenT.AuTOMatioN.PScrEDENtIal]::Empty
    )

    PROCESS {
        ForEach ($ComPUTEr in $cOmpuTeRNAmE) {
            try {
                $ = @{
                    'ComputerName' = $cOmpuTeRNAmE
                    'Class' = 'Win32_process'
                }
                if ($PSBoUNDpARAMEteRs['Credential']) { $['Credential'] = $CREdentiaL }
                Get-WMIobject @WmiArguments | ForEach-Object {
                    $OWnER = $_.getowner();
                    $ProcEss = New-Object pSOBJect
                    $ProcEss | Add-Member Noteproperty 'ComputerName' $ComPUTEr
                    $ProcEss | Add-Member Noteproperty 'ProcessName' $_.ProcessName
                    $ProcEss | Add-Member Noteproperty 'ProcessID' $_.ProcessID
                    $ProcEss | Add-Member Noteproperty 'Domain' $OWnER.Domain
                    $ProcEss | Add-Member Noteproperty 'User' $OWnER.User
                    $ProcEss.pSOBJect.TypeNames.Insert(0, 'PowerView.UserProcess')
                    $ProcEss
                }
            }
            catch {
                Write-Verbose "[qsemLJwQVOHqCIoClLDnUvELfcgRWFAVJqOpuQELN] Error enumerating remote processes on '$ComPUTEr', access likely denied: $_"
            }
        }
    }
}


